				 	onClick={(event) => props.get_answer(event, props.question_answer), () => {props.answered()} }>
					True
				</button>
				<button value="false"
					onClick={(event) => props.get_answer(event, props.question_answer), () => {props.answered()} }>
					False
				</button>
			</div>
		)
